import React, {Component} from 'react';

class GameState extends Component {
  state={
    qBank: [],
    numberq: 1
  }

  render() {
    return (
      <div className="score-board">
        <div className="score">
          You will now answer {this.state.numberq} questions!
        </div>
      </div>
    );
  }

}

export default GameState;
